import Headerplus from "./components/Headerplus";
import Video from "./components/Video";
import VideoText from "./components/VideoText";
import Trial from "./components/Trial";
import MiddleF from "./components/MiddleF";
import Down from "./components/Down";
import Testinimial from "./components/Testinimial";
import Testinimials from "./components/Testiminials";
import Payment from "./components/Payment";
import Cards from "./components/Cards";
import Footer from "./components/Footer";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import TrialPage from "./components/TrialP"




function App() {
  return (
    <Router>
      <Switch>
        <Route path="/Trials">
          <Trial />
        </Route>
      </Switch>
      <div>
        <Headerplus />

        <VideoText />

        <Video />

        <MiddleF />
        {/* <Trial /> */}
        <Testinimial />

        <Testinimials />

        <Cards />

        {/* <Payment /> */}

        {/* <Footer /> */}
        <Down />
      </div>
    </Router>
  );
}

export default App;
